"<div>\n<i class=\"NoteType\">\nCitation\n</i>\n<div class=\"grampsstylednote\">\n<p>\nSource Citation\n</p>\n<p>\nYear: 1870; Census Place: Orangeville, Wyoming, New York; Roll: M593_1119; Page: 242A<br />\nDescription\n</p>\n<p>\nTownship: Orangeville<br />\nSource Information\n</p>\n<p>\nAncestry.com. 1870 United States Federal Census [database on-line]. Provo, UT, USA: Ancestry.com Operations, Inc., 2009. Images reproduced by FamilySearch.<br />\nOriginal data:1870 U.S. census, population schedules. NARA microfilm publication M593, 1,761 rolls. Washington, D.C.: National Archives and Records Administration, n.d.Minnesota census schedules for 1870. NARA microfilm publication T132, 13 rolls. Washington, D.C.: National Archives and Records Administration, n.d.<br />\nSource Description\n</p>\n<p>\nThis database is an index to individuals enumerated in the 1870 United States Federal Census, the Ninth Census of the United States. Census takers recorded many details including each person's name, age at last birthday, sex, color; birthplace, occupation, and more. No relationships were shown between members of a household. Additionally, the names of those listed on the population schedule are linked to actual images of the 1870 Federal Census.\n</p>\n</div>\n</div>",
