"<div>\n<i class=\"NoteType\">\nCitation\n</i>\n<div class=\"grampsstylednote\">\n<p>\nARTHUR SCHAUMLEFFEL never married. He graduated from Buffalo State Teachers' College and taught in rural schools in teh Warsaw area for a few years. He continued to live on the home farm after the death of his parents, but then for health reasons moved to Phoenix and then Sun City, Arizona. He was injured seriously in an auto accident which caused his death on January 20th, 1971.\n</p>\n<p>\nArthur bequeathed three-tenth of his estate for a scholarship fund to be administered by the Immanuel United Methodist Church of Warsaw, as a memorial to his father and mother, George and Katherine Schaumleffel. The amount of this bequest was $53,000. Only the interest from this bequest may be used. The scholarships are for those planning to go into full-time Christian work. Out of many requests for this aid, four or five students are chosen each year.\n</p>\n</div>\n</div>",
