"<div>\n<i class=\"NoteType\">\nGeneral\n</i>\n<div class=\"grampsstylednote\">\n<p>\nOf S. Main St. Warsaw died instantly before noon at the barns of Wm. McCauley on the Smith farm near the Bathrick School House on the E. Hill. Mr. Adams was working for Charles Toal of Wyoming engaged in threshing and had finished his work at one place and was preparing to thresh at the McCauley barns. He was driving the separator and had driven into the barn when he turned back to see if the machine was in. The outfit gave a sudden lurch, Mr. Adams was in a standing position and his head struck on overlay. His neck was broken and death was instantaneous. The deceased was 25 years of age and was a son of Mr. and Mrs. Eugene Adams of Warsaw E. Hill. About 3 years ago he was united in marriage to Miss Gertrude Reitzel who survive him together with his parents, 1 brother Lloyd Adams of E. Warsaw and a half brother Charles Wythe of Corning. Much sympathy is felt for the bereave relatives in their terrible affliction.\n</p>\n</div>\n<i class=\"NoteType\">\nURL\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.findagrave.com/memorial/7840487/john-m-adams\n</p>\n</div>\n</div>",
