"<div>\n<i class=\"NoteType\">\nURL\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.findagrave.com/memorial/125623575/anne-clara-garey\n</p>\n</div>\n<i class=\"NoteType\">\nGeneral\n</i>\n<div class=\"grampsstylednote\">\n<p>\nAnne C. Garey (1920 - 2014)\n</p>\n<p>\nOLEAN - Anne C. Garey, of 525 East Spring St., passed away Wednesday, (Feb. 19, 2014), at Olean General Hospital after a brief illness.\n</p>\n<p>\nBorn April 27, 1920, in Lewistown, Pa., she was a daughter of the late Harry and Mildred Bruner. On Dec. 6, 1937, in the Parsonage of First Baptist Church, Olean, she married John L. Garey, who survives.\n</p>\n<p>\nShe was employed at various places including Olean Tile Co., W.T. Grants, Leo's Bakery, and retired from the JC Penney Company.\n</p>\n<p>\nAnne was a member of the First Baptist Church, Olean, and loved to crochet, volunteer at Olean General Hospital, and take trips to Florida. She loved her grandchildren and great grandchildren and enjoyed the company of Dave and Sharyn.\n</p>\n<p>\nIn addition to her husband of 76 years, she is survived by two daughters, Nancy Shewairy of Ocala, Fla., and Sharyn (Dave Hornburg) Garey of Olean; 10 grandchildren; and 13 great-grandchildren.\n</p>\n<p>\nShe was predeceased by a son, John A. Garey, Oct. 25, 1990; three sisters; and four brothers.\n</p>\n<p>\nBurial will be in Allegany Cemetery.\n</p>\n<p>\nMemorials may be made to the First Baptist Church, 133 South Union St., Olean, NY 14760 or St. Jude Children's Research Hospital , PO Box 1000 Dept. 42, Memphis, TN 38148-0142.<br />\n------------<br />\nPublished in The Olean Times Herald from Feb. 21 to Feb. 22, 2014 \n</p>\n</div>\n</div>",
