"<div>\n<i class=\"NoteType\">\nURL\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.weeksfuneral.com/obituary/bonnie-causer?fbclid=IwAR1E7a_iL2sSqiwUEzi9ZUastaHah5aWKKah61QVuFhvRntCbQAt54LEvBA\n</p>\n</div>\n<i class=\"NoteType\">\nGeneral\n</i>\n<div class=\"grampsstylednote\">\n<p>\nBonnie D. Causer, age 77, of Linwood Ave. Warsaw, passed away peacefully, Sunday October 31st 2021 at the Wyoming County Community Hospital surrounded by her loving family. A dedicated Buffalo Bills fan, she passed about halftime and arrived in Heaven just in time to cheer them on for the win. Bonnie was born in Olean, July, 18th 1944, a daughter of the late Harold W. and Mabel I. Elliott Bruner. A 1963 graduate of Allegany Central School, Bonnie attended and graduated from Keystone College earning a degree in the culinary arts. She worked in food service management at various places throughout Western New York along with Montrose Bible Camp, Top of the Hill Restaurant and she was instrumental in forming the kitchen at the newly opened Cloisters in Warsaw. She attended Valley Chapel Free Methodist Church in Warsaw but was baptized and confirmed at St. John's Lutheran Church in Allegany, NY. Bonnie was dedicated to helping her family in any way she could practically raising her grandchildren while her daughter worked. She was a terrific listener and the best mother that she knew how to be.\n</p>\n<p>\nBonnie was preceded by her brothers Victor L. Bruner and David L. Farr, her sister Beverly A. Farr and an infant son Glen A. Causer.\n</p>\n<p>\nSurvivors include her daughter Melinda (Darrick Ulm) Herman of Varysburg, a brother John J. (Becky) Bruner of Clark Summit, PA, a sister Deana (Tom) Griffith of Las Vegas, NV, four grandchildren,; Joshua (Ashley Carney) Herman of Charlotte, NC, Emma Mabel Herman of Lewiston, NY, Shelby and Dylan Ulm of Varysburg, along with several nieces, nephews and all of her close friends at Pinewood apartments as well as her beloved Shih-Tzu \u201cMacy\u201d.\n</p>\n<p>\nA graveside service will be held at 3pm Monday, November 8th 2021 at the Allegany Cemetery on Maple Street Allegany. Weeks Funeral Home 123 N. Main Street Warsaw has arrangements. Please visit www.weeksfuneral.com to offer condolences.\n</p>\n<p>\nMemorial contributions are requested to the Wyoming County SPCA at 808 Creek Road Attica, NY 14011.\n</p>\n</div>\n</div>",
