"<div>\n<i class=\"NoteType\">\nURL\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.tributearchive.com/obituaries/22602677/ruth-m-hinz/warsaw/new-york/robinson-and-hackemer-funeral-home\n</p>\n</div>\n<i class=\"NoteType\">\nGeneral\n</i>\n<div class=\"grampsstylednote\">\n<p>\nAge 80, of Warsaw, passed away on October 6, 2021 at the Wyoming County Community Hospital in Warsaw.\n</p>\n<p>\nShe was born December 23, 1940 in Stillwater, New Jersey, daughter of the late Chester and Marion Mortimer Brown. Ruth was employed as a licensed practical nurse at the former St. Jerome\u2019s Hospital in Batavia for many years. She was an active member of the Immanuel United Church of Christ in Orangeville (Dutch Flats). In earlier years, Ruth was a 4 \u2013 H leader for several years and was a longtime member of the Caravan for Cancer in Wyoming County.\n</p>\n<p>\nRuth was predeceased by her husband of sixty-three years, Keith R. Hinz and one great grandchild.\n</p>\n<p>\nSurviving are her children, Donald (the late Joanne) Hinz of Seattle, WA, Karl (Paula) Hinz of Attica, Marcia (Joe Regan) Jennings of Warsaw, Jeff (Cindy) Hinz of Warsaw; eight grandchildren; seven great grandchildren; her siblings, Diane (Skip) Wolcott of Perry, David (Doris) Brown of Silver Springs, Ron (Pat) Brown of Hermitage; several nieces and nephews.\n</p>\n<p>\nThere are no calling hours. Ruth\u2019s memorial service will be held Monday, October 11 at 11 AM at the Immanuel United Church of Christ, 2165 Exchange St., Orangeville, NY. In lieu of flowers, memorials may be made to the Immanuel United Church of Christ, 2165 Exchange St., Attica, NY 14011.\n</p>\n</div>\n</div>",
