"<div>\n<i class=\"NoteType\">\nURL\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.findagrave.com/memorial/53657894/dorothy-ruth-causer\n</p>\n</div>\n<i class=\"NoteType\">\nGeneral\n</i>\n<div class=\"grampsstylednote\">\n<p>\nMrs. Maude Bell Kinney, 79, of East Smethport, died at 6:15 am Thursday in the Olean NY General Hospital where she had been a patient since Saturday.<br />\nShe was born on Aug.27,1887, at Penfield, daughter of the late Joseph and Sara Boyer King.<br />\nShe was married to Grover P. Kinney at Cross Forks in 1902.<br />\nThe couple resided there and at Somerset County, Betula and Roulette before moving to the East Smethport area.<br />\nSurviving are her husband; four sons, Jack E., Earl J., and Wilbur O. of Smethport, and Paul F. Kinney, whose address is unknown; four daughters, Mrs. Gladys Wright of Smethport, Mrs. Glen Causer, of Olean, Mrs. Robert Kilby of Cattaraugus, N.Y., and Mrs. Leon. Green of Port Allegany; one sister, Mrs. Margaret Kinney of' Sheffield; 38 grandchildren, 89 great grandchildren, two great-great-grandchildren, and several nieces and nephews.<br />\nFuneral services were conducted at the Fry Funeral Home at 2 p.m. Saturday. The Rev. H. W. Beveridge, pastor of First Methodist Church officiated and burial was in McKean Memorial Park at Lafayette. Bearers, all grandsons, were Llewellyn Wright, Leon and William Kinney, Donald, Leon and Ronald Green, Roger Skinner and Kenneth Causer.\n</p>\n<p>\n(McKean County Democrat Thursday, February 16, 1967)\n</p>\n</div>\n</div>",
