"<div>\n<i class=\"NoteType\">\nURL\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.findagrave.com/memorial/18811754/charles-s.-smith\n</p>\n</div>\n<i class=\"NoteType\">\nGeneral\n</i>\n<div class=\"grampsstylednote\">\n<p>\nAge, 18 years. Enlisted, August 30, 1862, at Warsaw, New York, to serve three years; mustered in as private, Co. E, 136th New York Inf., September 25, 1862; wounded, no date; mustered out, May 13, 1865 at hospital, Rochester, N.Y.\n</p>\n<p>\nPer 1890 veteran's census: hurt in groin at Resaca\n</p>\n<p>\nThe Western New Yorker<br />\nJune 19, 1919\n</p>\n<p>\nCharles Smith died at the family home on the West Hill on Saturday, June 7, age 75 years and 8 days. He was born in Orangeville on May 30, 1844, son of Philip and Philipena Dick Smith. On March 12, 1868 he was united in marriage to Miss Louisa Herman of Buffalo who died on July 27, 1892. He was again married on April 25, 1894 to Miss Dorothy Hausauer of Buffalo who survives. He was a member of the 136th Regiment and served three years in the Civil War. He is survived by two sons, William C. and Edwin G. Smith of Warsaw;; two grandchildren, Clara Louise and Edna Irene Smith; two brothers, Henry and J.P. Smith of Warsaw; three sisters, Mrs William Miller, Mrs. Sarah Sergel of Warsaw, and Mrs. William Werner of Orangewille, One daughter Clara Louise died in infancy. Served in the Civil War for 3 years.<br />\nFuneral services were held at two o'clock Tuesday afternoon from his late home, Rev. Rothen officiating, assisted by Rev F.W. Schwenk of Buffalo and Ernest Sergel of Warsaw. The G.A.R. of which he was a member, the W.R.C. and the S.O.V. were all represented at the funeral. Interment was in the Warsaw cemetery.<br />\nThose from out of town who were present at the funeral services were Mr. and Mrs. Fred L. Goetz of East Aurora; Bert Webster and family and Mrs. Mary Haselbauer of Corning; Mrs. John Roberts of Batavia; Rev. A.B. Sherman Ellicottville; Mrs. Arthur Walker of Bennington; Mr. and Mrs. Strayline of Wyoming; Fanny Herman, Donald Herman and Rev. F.W. Schwenk of Buffalo. \n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nCitation\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.findagrave.com/memorial/70964041/charles-w-bruner\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nURL\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.tributearchive.com/obituaries/11699609/Chester-Brown\n</p>\n</div>\n<i class=\"NoteType\">\nGeneral\n</i>\n<div class=\"grampsstylednote\">\n<p>\nChester E. Brown, age 87, of Orchard St., Silver Springs went to his eternal rest and reunited with his loving wife on Sunday December 11, 2011.<br />\n\t<br />\nHe was born June 23, 1924 in Orangeville, New York a son of the late Clyde and Bessie Pfiefer Brown.\n</p>\n<p>\nA man of great faith he was a member of the New Beginnings Fellowship Church in Hermitage and a former member of the Oatka Baptist Church.  He enjoyed deer and pheasant hunting, country music and making music whether it was singing, or playing piano, fiddle, or guitar.  He was a carpet installer for Zeches Furniture in Warsaw for close to 20 years.\n</p>\n<p>\nOn November 10, 1941 in Castile he married the love of his life, Marion L. (nee Mortimer) Brown and they enjoyed 67 years of marriage before she was called Home on November 26, 2008.\n</p>\n<p>\nHe is survived by his children: Ruth (Keith) Hinz of Attica, David (Doris) Brown of Silver Springs, Diane (Skip) Wolcott of Perry, Ron (Pat) Brown of Hermitage; a sister-in-law: Eleanor Barnes of Easton, PA; 13 grandchildren, 31 great-grandchildren, one great-great-grandson and several nieces and nephews.<br />\n\t<br />\nIn addition to his wife he was preceded in death by a sister and brother-in-law: Lucille and Norman Smith and a brother-in-law: Albert Barnes.<br />\n\t<br />\nThere are no calling hours.  Funeral services will be held Wednesday December 14, 2011 at Noon in the New Beginnings Fellowship Church, 4377 Route 78, Gainesville.<br />\n\t<br />\nBurial will be in Union Park Cemetery, Wethersfield Springs.  Memorials may be made to the Silver Springs Rescue Squad.\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nURL\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.findagrave.com/memorial/24356323/clara-l.-wilcox\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nURL\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.findagrave.com/memorial/27935761/clara-crawford\n</p>\n</div>\n<i class=\"NoteType\">\nGeneral\n</i>\n<div class=\"grampsstylednote\">\n<p>\nDaughter of Almon Mason Warren and Mary Elizabeth Taylor. Wife of Joseph Revere Crawford, whom she married on June 24, 1914, in Wyoming Co., NY.\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nURL\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.findagrave.com/memorial/114625727/clarence-lloyd-babcock\n</p>\n</div>\n<i class=\"NoteType\">\nCitation\n</i>\n<div class=\"grampsstylednote\">\n<p>\nSon of William Martin Babcock and Mabel Blauvelt...Married Emma J Babcock....\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nURL\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.findagrave.com/memorial/48832466/clarissa-louise-taylor\n</p>\n</div>\n<i class=\"NoteType\">\nCitation\n</i>\n<div class=\"grampsstylednote\">\n<p>\nClarissa Louise Clark was the daughter of James C Clark and Lucinda Augusta \"Gusty\" Gillett.\n</p>\n<p>\nShe lived her entire life in Darien or Darien Center.\n</p>\n<p>\nShe married Marcellus E Taylor on October 30, 1878.\n</p>\n<p>\nThey had two children: Jennie Louise 1880, who married Frank Yates and Hervey William Carter, and Clifford Marcellus Taylor 1894.\n</p>\n<p>\n-------------------\n</p>\n<p>\nObituary Clara Taylor<br />\nDarien Center Oct 14 1941<br />\nMrs. Clara Louise Taylor 82 widow of Marcellus E Taylor and a life-long resident of this vicinity, died at 4 o'clock this morning (Oct 14, 1941) at the home of a daughter, Mrs. Frank Yates of Darien Center. She had been in failing health for several weeks. Mrs. Taylor, a daughter of the late James C and Augusta Clark, was born at the Clark Homestead on the Seven Day Road on September 19, 1859. She was a member of the Methodist Church. Her husband to whom she was married on October 30, 1878, died on August 10, 1924. Besides her daughter, Mrs. Taylor is survived by two brothers, Frank W Clark of Darien Center and Fred C Clark of Saranac Lake, a sister, Mrs. Adelbert L Shumaker of Rochester and four grandchildren, Harvey C Carter of Providence, RI, Private Warren E Yates of Barksdale Field, La, Mary Louise and Clifford M Taylor Jr. of Buffalo. A son, Clifford M then commercial manager of Radio station WBEN in Buffalo, died in March, 1940. Private funeral services for Mrs. Taylor will be held from the daughters home at 2 o'clock on Thursday afternoon, the Rev. Squire Schofield of St Johns Rectory, South Williamport, Pa. officiating. Interment will be in Darien Cemetery. Friends may call at home.\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nURL\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.findagrave.com/memorial/17911422/william-campbell-kean\n</p>\n</div>\n<i class=\"NoteType\">\nGeneral\n</i>\n<div class=\"grampsstylednote\">\n<p>\nUnion soldier, Civil War. Co. A 125th PA Vol. Inf. 70y, 3m, 17d<br />\nfrom a member: ( errors left in)<br />\nWilliam Campbell Kean was the son of John Kean and Jane Guthrie Kean.His Birth 25 May 1828 in Bedford, Huntingdon Co., PA. Death 12 Sep 1898 in Hollidaysburg, Pennsylvania, USA. He was married to Anna Mary Baker in 1856 and had 10 children.\n</p>\n</div>\n</div>",
