"<div>\n<i class=\"NoteType\">\nURL\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.findagrave.com/memorial/68635829/chap\n</p>\n</div>\n<i class=\"NoteType\">\nGeneral\n</i>\n<div class=\"grampsstylednote\">\n<p>\nDONNA J. CHAPMAN\n</p>\n<p>\nOLEAN - Donna J. Chapman, a resident of Lakeview Manor in Smethport died Friday November 21, 2003 at the Bradford Regional Medical Center.\n</p>\n<p>\nBorn in Roulette, PA on February 12, 1936 she was a daughter of Glenn and Dorothy Kinney Causer. She enjoyed playing bingo, crafts and singing. Donna loved her family, especially her grandchildren.\n</p>\n<p>\nShe is survived by her companion Robert D. Chapman, two daughters Donna (Joe) Donovan and Roxanne (Ken) Baldwin both of Olean; a son Robert (Shawna) Chapman of Great Valley; eight grandchildren; one great grandchild; one brother Richard Causer of Osage Beach, MO ; seven sisters Thelma Davis, Glenna Larkin, Vera Fenton, Melva Swick, all of Port Allegany, PA, Joan Sherwood of Clearwater, FL , Carol Trainer of Savage, MN and Janet Swick of Cyclone, PA.\n</p>\n<p>\nIn addition to her parents, she was predeceased by three brothers Jack Causer, Ken Causer and Robert Causer.\n</p>\n<p>\nFriends will be received Monday November 24, 2003 at the Casey, Halwig &amp; Hartle Funeral Home, 3128 West State Rd., Olean from 11:00 AM until 1:00 PM at which time funeral and committal services will be conducted. Pastor Dana LaPage, of the Regular Baptist Church of Smethport, PA will officiate. Burial will be in Mt. View Cemetery, Olean.\n</p>\n<p>\nMemorials may be made to a charity of the donor's choice. \n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nURL\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.findagrave.com/memorial/167658450/marvin-s.-cohen\n</p>\n</div>\n</div>",
