"<div>\n<i class=\"NoteType\">\nURL\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.findagrave.com/memorial/18382693/earl-t.-herman\n</p>\n</div>\n<i class=\"NoteType\">\nGeneral\n</i>\n<div class=\"grampsstylednote\">\n<p>\nWyoming County Times, Thursday March 27, 1947<br />\nEarl T. Herman of 11 Empire street, Warsaw, for many years foreman in the assembly room at the Warsaw Elevator plant died at his home on Monday, March 24th. He was born in Orangeville on October 1, 1878, the son of Theodore and Louise Streamer Herman. On July 2, 1902 he married Eva J. Sickley who survives him. He aso leaves three sons, George S. Roy and Theodore F. Herman of Warsaw; four grandchildren, two brothers, William H. of Rochester, Miles G. of Orangeville and a sister, mrs. Water Wilcox of Warsaw. The funeral was held on Wednesday, March 26th at 2:30 at the Weeks Funeral Home with the burial in Warsaw. The Rev. James O. Bell officiated. Mr. Herman was a member of the Baptist church, of I.O.O.F. Lodge No. 505 and Warsaw Rebekah Lodge and was a Past Grand of Crystal Salt Lodge.\n</p>\n</div>\n</div>",
