"<div>\n<i class=\"NoteType\">\nCitation\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.findagrave.com/memorial/61774643/elizabeth-jenison\n</p>\n</div>\n<i class=\"NoteType\">\nGeneral\n</i>\n<div class=\"grampsstylednote\">\n<p>\nSpouse Peter Jenison<br />\nElizabeth Snow and Peter Jenison were wed on February 14, 1790. They were known as \"Godly people\", members of the M. E. church; mother in early life was in communion with the Presbyterian church. They reared a family of ten children, (a son dying in infancy). They came to Gainesville from Tyrringham, Masschusetts in 1809. Peter Jenison died in 1849 at the age of 79 years and Elizabeth passed in 1861 at the age of 91 years. Burial was in the North Gainesville cemetery at Lot 23, the gravestone is not fully readable and death date may be 1864.<br />\nS Rutherford Historian Notebook\n</p>\n<p>\nHistorical Wyoming, July 1955 \"Glimpses of Gainesville\" mentions name and will give information on early settlers.<br />\nNot on Historical Wyoming 1949 List\n</p>\n</div>\n</div>",
