"<div>\n<i class=\"NoteType\">\nGeneral\n</i>\n<div class=\"grampsstylednote\">\n<p>\nA former Yuma resident, Esther Ewing, died Monday, October 20, 2008 at Beautitudes Campus of Care in Phoenix. She was 95 years old. While in Yuma, she worked as a nurse at Yuma County Hospital, at the offices of Drs. Phillips, Irwin and Podolsky, and for Yuma School District No. One.\n</p>\n<p>\nEsther was preceded in death by her beloved husband, Arden Ewing; brother, Larry Smith of Yuma; and sisters, Florence Nevinger and Ruth Bryant of Warsaw, New York; and brother, Lynn Smith of Sweet Home, Arkansas. She also leaves behind a son, Ron Ewing, of Phoenix; daughter, Becky Hardy of Clio, California; along with four grandchildren and five great- grandchildren.\n</p>\n<p>\nA memorial service was held in Phoenix at the Beautitudes Campus Chapel on October 22, 2008. Burial took place at Desert Lawn Cemetery in Yuma on October 24, 2008. In lieu of flowers the family requests donations to Hospice of Yuma in Esther's name.\n</p>\n</div>\n<i class=\"NoteType\">\nURL\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.legacy.com/us/obituaries/yumasun/name/esther-ewing-obituary?pid=119459908\n</p>\n</div>\n</div>",
