"<div>\n<i class=\"NoteType\">\nURL\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.findagrave.com/memorial/18380482/henry-d.-smith\n</p>\n</div>\n<i class=\"NoteType\">\nGeneral\n</i>\n<div class=\"grampsstylednote\">\n<p>\nWyoming County Times, dated Thursday Aug. 9, 1923:<br />\nThe funeral of Henry D. Smith of Warsaw was held from the home of Henry Sergel on Peck Hill at 10 o'clock Sunday morning and from the German Evangelical church at 11 o'clock. Rev. Schienk officiating. Mr. Smith was born in Sheldon October 30, 1846 and was the son of Phillip Smith and Philipene Dick. He married Saloma Nevinger in 1868. She died July 12, 1916. He is survived by one brother, John P. Smith and two sisters, Mrs. Caroline Miller and Mrs. Sarah Sergel of Warsaw, one daughter, Mrs. Charles New and 4 grandchildren. He was a farmer and a member of the German Evangelical church. For many years Mr. Smith owned a home on South Maple street in the village, but he sold that a few years ago, and for a time has been making his home with Henry Sergel, a nephew.\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nURL\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.findagrave.com/memorial/428994/herbert-ward-bruner\n</p>\n</div>\n<i class=\"NoteType\">\nGeneral\n</i>\n<div class=\"grampsstylednote\">\n<p>\n&nbsp;\n</p>\n<p>\nInscription\n</p>\n<p>\n    New York<br />\n    PFC Co G 26 Inf<br />\n    1 Division \n</p>\n<p>\n&nbsp;\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
