"<div>\n<i class=\"NoteType\">\nURL\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.findagrave.com/memorial/189605896/jean-m.-todd\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nURL\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.findagrave.com/memorial/175369397/jessie-e-smith\n</p>\n</div>\n<i class=\"NoteType\">\nGeneral\n</i>\n<div class=\"grampsstylednote\">\n<p>\nJessie E. Smith, age 100, of Warsaw, passed away on January 13, 2016 at Strong Memorial Hospital in Rochester.\n</p>\n<p>\nShe was born on July 18, 1916 in Orangeville, New York, daughter of the late Abraham and Mary Baker Smith. Jessie was a graduate of Warsaw High School Class of 1935 and was a graduate of the State University of New York at Geneseo. She began her teaching career in area rural schools before teaching for twenty-three years at Warsaw Central School; retiring in 1978.\n</p>\n<p>\nJessie was a longtime member of the Immanuel United Methodist Church in Warsaw. She was a member of the New York State Retired Teachers Association and the Wyoming County Retired Teachers Association. She was also a member of the Warsaw Historical Society and the Warsaw Monday Club.\n</p>\n<p>\nJessie was predeceased by her husband, Harold G. Smith who died in 2002.\n</p>\n<p>\nSurviving are her daughter, Mary Ann (Robert) Wise of Midland, Michigan; her son, Dr. Philip H. (Dr. Gail Robertson) Smith of Madison, Wisconsin; her grandchildren, Michael (Heather) Prentice, John (Katherine) Prentice, Keenan Jesse Smith; great grandchildren, MacKinley, Riley and Jamie Prentice; her brother, Lynn (Maureen) Smith of Mountain Home, Arkansas. She was the sister of the late Lawrence Smith, Ruth Bryant, Florence Nevinger, Norman Smith and Esther Ewing.\n</p>\n<p>\nFriends may call Monday, January 16 from 3 \u2013 7 PM at Robinson &amp; Hackemer Funeral Home, 246 N. Main St., Warsaw where Jessie\u2019s funeral service will be held on Tuesday, January 17 at 12 PM. Burial will be in Warsaw Cemetery. In lieu of flowers, memorials may be made to the Immanuel United Methodist Church, Warsaw.\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nURL\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.findagrave.com/memorial/130502724/john-b-ward\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nURL\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.findagrave.com/memorial/8067349/john-herman\n</p>\n</div>\n<i class=\"NoteType\">\nGeneral\n</i>\n<div class=\"grampsstylednote\">\n<p>\nJohn Herman died at North Java on Sunday, February 12th, 1899, aged 77 years. He was born July 27th, 1822 in Hertzenhein, Nassaw, (now Prussia), Germany, and came to the United States with his wife, in 1840, locating in Orangeville where he had resided until 2 years ago, when he went to North Java to live with his son, Jacob Herman. His wife died December 8th, 1895. He was highly esteemed by friends and neighbors. The immediate cause of death was heart disease, hastened by a severe attack of grip. Of a family of 10 children, three are now living - Henry W., who is the Klondike gold region, Mrs. Flora Davidson of Warsaw, and J. H. Herman of North Java. The funeral was held on Tuesday from the home of his son, Rev. W. Parker officiating, and interment in the Evangelical cemetery, Warsaw west hill.\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nCitation\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.findagrave.com/memorial/96717126/john-howard-crawford\n</p>\n</div>\n<i class=\"NoteType\">\nGeneral\n</i>\n<div class=\"grampsstylednote\">\n<p>\nAge 90, of Warsaw, died at the Livingston County Rehabilitation Facility in Mt. Morris, NY. He was born in Attica, son of the late Joseph R. and Clara J. Warren Crawford. John was a graduate of Warsaw Central School and served in as a Sargent in the US Army Air Force. He was employed for many years in the tool and die department of General Motors in Tonawanda. John enjoyed reading and was a lifelong fitness buff, often seen running the track at the Warsaw Village Park or walking his circuit around the town. He was predeceased by his wife of 62 years, Theresa F. Tavernier Crawford who died on March 25, 2012. They were married in Dallas, TX on July 5, 1949. Surviving are his daughters, Joanne (Bruce) Caldwell of Warsaw, Linda (Randy) Cofield of Geneseo, Carol (Michael) Gburek of Warsaw, Lori Roberts of Warsaw; his grandchildren, Joseph (Kristen) Caldwell, Craig (Tanya) Caldwell, John Caldwell, Krista (Joseph) Benson, Renee Cofield, Jennifer and Michael Eccleston, Margaret, Colleen and Maureen Gburek, Daniel Fili and Nicole Roberts; great grandchildren, William and Lilly Caldwell, Angel and Katie Rimes, Makena and Malea Benson; his sisters, Jean Todd and Dorothy Herman both of Warsaw. He was the brother of the late Willard and Daniel Crawford and Norma Graham.\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nURL\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.findagrave.com/memorial/53703454/joseph-edward-king\n</p>\n</div>\n<i class=\"NoteType\">\nGeneral\n</i>\n<div class=\"grampsstylednote\">\n<p>\nAlt. birth 16 Jun 1842,Son of Marcel Roy in Quebec,Canada.Joseph changed his Last name to King on arrival to the U.S.\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nGeneral\n</i>\n<div class=\"grampsstylednote\">\n<p>\nSon of Frederick Lincoln Crawford and Nettie E. Willard.<br />\n.<br />\nHusband of Clara J. Warren, whom he married on June 24, 1914, in Wyoming Co., NY.<br />\n.<br />\nOBITUARY:<br />\nCastile News: Joseph R. Crawford, age 39, died on Monday, August 3d, at the Masonic Hospital in Utica, where he had been since November 1926. The body was brought to the home of his mother the same day, and funeral services were held last Wednesday afternoon at 2:30, Rev. Eldredge of Canaseraga officiating. Masonic rites were conducted at the grave by Oakland Lodge of this pace with burial in Hope Cemetery. [Error? or were the remains moved?]<br />\nThe deceased was a son of Mr. and Mrs. F. L Crawford and was born in Castile. For a number of years he was employed by the Erie Railroad, being a clerk in the superintendent's office in Buffalo and later an agent at Attica, Lancaster and Canaseraga.<br />\nHe was married to Miss Clara J. Warren of Castile, who survives him. He is also survived by his mother and six children, one sister, Mrs. George Pixley of Castile; and two brothers, Earl of Castile and Ray of Nunda.<br />\n(Perry, NY, Record, August 13, 1931)<br />\n.\n</p>\n</div>\n<i class=\"NoteType\">\nURL\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.findagrave.com/memorial/27935732/joseph-revere-crawford\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nURL\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.findagrave.com/memorial/47230298/kate-baker\n</p>\n</div>\n<i class=\"NoteType\">\nGeneral\n</i>\n<div class=\"grampsstylednote\">\n<p>\nFrom her obituary:<br />\nBorn: Orangeville Dau of Martin Schlenker and Mary Golar<br />\nDied Orangeville July 9, 1912 57y<br />\nSurvived: husb.; dau Mrs. Mary Smith, Orangeville; 6 brothers Martin of Darien, John and Walter of Attica; Peter, George and Mathew of Orangeville; 3 sis: Mrs. Barbara Welz of Orangeville and Mrs. John West of Varysburg, Mrs. Mary Ripstein of Attica.\n</p>\n</div>\n</div>",
