"<div>\n<i class=\"NoteType\">\nURL\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.findagrave.com/memorial/97162397/luther-brown\n</p>\n</div>\n<i class=\"NoteType\">\nGeneral\n</i>\n<div class=\"grampsstylednote\">\n<p>\n\"Luther Brown nil native of Gainesville, and tbe oldest son of Nehemlah Brown. His wife, Hannah, was a daughter of John Russell, a prominent settler of Gainesville. He was at Hermitage in tbe grocery trade nearly eighteen years from 18(0, and was justice of tbe peaoe for several yean. About 1868 he removed to a farm in Eagle, where be died November 19th, 1875.\"\n</p>\n<p>\nHistory of Wyoming Co., New York, page 303<br />\nGEO. MACNAMARA, Printer, 36 Vesey St., N. Y. - 1880. W. E. MORRISON &amp; CO., Printers, Ovid, N. Y. - 1976.\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nURL\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.connerfamilyfuneralhome.com/obituary/lynn-smith\n</p>\n</div>\n<i class=\"NoteType\">\nGeneral\n</i>\n<div class=\"grampsstylednote\">\n<p>\nLynn Arthur Smith, 91, of Mountain Home, Arkansas passed away Thursday, October 24, 2019. He was born June 24, 1928 in Warsaw, New York to the late Abram and Mary (Baker) Smith. Lynn was a veteran of the United States Army from 1950 to 1952 with distinguished service in the Special TRUST Forces in Italy. Lynn is preceded in passing by his parents, five sisters and two brothers.\n</p>\n<p>\nLynn is survived by his wife of 36 years, Maureen Smith of Mountain Home, Arkansas; his children from a previous marriage, two sons, Kent (Katharine) Smith of Connecticut and Kevin (Jei) Smith of Florida; two daughters, Brenda (Ken) Smith of New York and Marsha Martin of New York; seven grandchildren, three great grandchildren and one great-great grandchild.\n</p>\n<p>\nLynn retired from Upstate Milk Cooperative as Director of Field Services and Membership. He volunteered in V.O.C.A., traveling to Latvia and Africa, sharing his knowledge in the dairy industry. In past years, Lynn enjoyed traveling, motorcycling, camping and flying his CESSNA 150. He loved the outdoors, wildlife and his pets. He was an avid Buffalo Sabres fan. Lynn was known for his gentle, kind and loving nature.\n</p>\n<p>\nServices will be private under the direction of Conner Family Funeral Home &amp; Cremation Center.\n</p>\n<p>\nMemorials may be made to the Humane Society of North Central Arkansas, 2656 AR 201 North, Mountain Home, AR 72653.\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nURL\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.findagrave.com/memorial/114623846/mabel-f.-elliott\n</p>\n</div>\n<i class=\"NoteType\">\nGeneral\n</i>\n<div class=\"grampsstylednote\">\n<p>\nDaughter of Levi Blauvelt and Mary Rose Safford..Married (1)William Martin Babcock..2 sons..Married (2)Theodore Elliott..2-4 children..\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nURL\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.findagrave.com/memorial/103506378/mabel-irene-bruner\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nURL\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.findagrave.com/memorial/32155675/marion-l.-brown\n</p>\n</div>\n<i class=\"NoteType\">\nGeneral\n</i>\n<div class=\"grampsstylednote\">\n<p>\nOf Orchard St., Silver Springs went home to her Lord on Wednesday, Nov. 26, 2008 at the Eastside Nursing Home in Warsaw. She was 86. She was born Dec. 4, 1921 in Warsaw, a daughter of the late William Mortimer and Olive Foster Mortimer Hardenber. She was a 1940 graduate of Warsaw High School and worked for 13 years as a clerk at the former Ames Department Store in Warsaw. A woman of great faith she was a member of the New Beginnings Fellowship Church in Hermitage and was a longtime member of the Oatka Baptist Church. She enjoyed crocheting, embroidery and baking and will be remembered for her cookies, molasses in particular. Her main focus was her family---being a loving wife, proud mother and affectionate grandmother. She is survived by her husband of 67 years, Chester Brown whom she married November 10, 1941 in Castile; two daughters, Ruth (Keith) Hinz of Attica, Diane (Skip) Wolcott of Perry; two sons, David (Doris) Brown of Silver Springs, Ron (Pat) Brown of Hermitage; one sister, Eleanor (late Albert) Barnes of Easton, PA; two half-brothers, Richard Hardenber of Georgia and Russell (Delores) Hardenber of Easton, PA; 13 grandchildren; 27 great-grandchildren; one great-great-grandson; many nieces and nephews. Two sisters preceded her in death, Sydney Mortimer who died in infancey, Shirley Groff and one brother, Malling Mortimer. There was no prior visitation. A memorial service was held Nov. 30, 2008 in the New Beginnings Fellowship Church, Hermitage. W.S. Davis Funeral Home, Arcade completed the arrangements.\n</p>\n</div>\n</div>",
