"<div>\n<i class=\"NoteType\">\nCitation\n</i>\n<div class=\"grampsstylednote\">\n<p>\nOlean Times Herald newspaper, Olean, Cattaraugus, New York<br />\nMay 5, 1969<br />\nTHEODORE ELLIOTT\n</p>\n<p>\n&nbsp;\n</p>\n<p>\nSHINGLEHOUSE, Pa  Theodore Elliott, 79 of Palmer Ave, died Thursday morning (Dec 4, 1969) at the Olean, (N.Y.)  General Hospital after a long illness.<br />\n  Born May 7, 1890, at Shinglehouse, he was a son of George and Margaret McLaughlin Elliott. In Bolivar, N.Y. Oct 5, 1912, he married to the former Mable Blauvelt, who survives.<br />\n  Mr Elliott retired in 1954 as an employe of the North Penn Gas Co. He had been a lifetime resident here. <br />\n  In addition to his widow, he is survivied by a daughter, Mrs Harold (Irene) Bruner of Allegany, N.Y.; three sons, Lloyd Babcock of Shinglehouse, Arnold Elliott and Mahlon Elliott, both of Eldred; 16 grand children and 32 great grandchildren; a sister, Mrs Walter (Ora) Roberts of Richburg, N.Y. and several nieces and nephews.<br />\n  Friends may call at the Howard Funeral Home where the family will be present from 2 to 4 and 7 to 9 p.m. today. The Rev Girard Drum, minister of St John's Lutheran church, Allegany,  will officiate for the funeral services in the fueranl home Saturday  (Dec 6, 1969) at 2 p.m. Interment will follow in Maple Grove Cemetery at Shinglehouse.\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nURL\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.findagrave.com/memorial/55773134/melva-l-swick\n</p>\n</div>\n<i class=\"NoteType\">\nGeneral\n</i>\n<div class=\"grampsstylednote\">\n<p>\nMelva L. Swick, 71, of Bradford, was a daughter of Glenn and Dorothy Kinney Causer.<br />\nMrs. Swick was a loving homemaker and will be missed by her family and friends.<br />\nShe is survived by daughter Dorothy Cornelius; sons Timothy Swick and Randy Swick; 8 grandchildren and many great grandchildren; sisters Thelma Davis, Glena (Jerry) Larkin, Janet Swick, Carol Trainer, and Joan (Chuck);and brother: Richard (Sue) Causer.<br />\nShe was preceded in death by her parents, a son Roger C. Swick, Jr. two daughters Tina Swick and Kathy Drabant three brothers and two sisters.<br />\nBurial in the Fairmont Cemetery, Farmers Valley.\n</p>\n</div>\n</div>",
