"<div>\n<i class=\"NoteType\">\nURL\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.findagrave.com/memorial/26039011/reuben-f.-pfeifer\n</p>\n</div>\n<i class=\"NoteType\">\nGeneral\n</i>\n<div class=\"grampsstylednote\">\n<p>\nDied in the Veterans Hospital in Buffalo after a long illness. Worked for the town of Orangeville and the town of Wethersfield. He worked 25 years for the Town of Warsaw, where he retired as superintendent of the highway department in 1965. Member of the former Evangelical United Bretheran Church of Quakertown. US Army veteran of WWI. Survived by his wife of 58 years, Loraine Pfeifer; 2 sons, Paul of Highland, CA and Gerald; one daughter, Maxine Hotchkiss; 1 sister, Bessie Brown; 8 grandchildren and 7 great grandsons.\n</p>\n</div>\n</div>",
