"<div>\n<i class=\"NoteType\">\nURL\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.findagrave.com/memorial/18316085/gertrude-reading\n</p>\n</div>\n<i class=\"NoteType\">\nGeneral\n</i>\n<div class=\"grampsstylednote\">\n<p>\nWestern New Yorker<br />\nMrs. Gertrude Reading, 87, formerly of 280 S. Main St., Warsaw, died Thursday, July 14, 1977 in Manor Oak Nursing Home. She had worked for the former Embury Lantern Co. and the former Brown Century Knitting Co. and was a member of the Friendly Rebekah Lodge. She attended the First Baptist Church. Surviving are two sons, Willard of Henrietta, and Henry of Denver; 9 grandchildren, and a sister, Mrs. Nellie Herman of Warsaw. Funeral services were held at the convenience of the family.\n</p>\n</div>\n</div>",
