"<div>\n<i class=\"NoteType\">\nURL\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.findagrave.com/memorial/86827398/robert-larry-causer\n</p>\n</div>\n<i class=\"NoteType\">\nGeneral\n</i>\n<div class=\"grampsstylednote\">\n<p>\nRobert L. Causer, Sr.<br />\nloving husband and father\n</p>\n<p>\nHINSDALE - Robert L. Causer Sr. of 4332 Gile Hollow Road died Monday (July 14,2003) at Northside Hospital, St. Petersburg, Fla., following an apparent heart attack.\n</p>\n<p>\nBorn March 17, 1942 in Roulette, Pa., he was a son of Glen and Dorothy Kinney Causer. On Sept. 9, 1995, he married the former Naomi Puccinelli, who survives.\n</p>\n<p>\nMr. Causer served with the U.S. Air Force for four years and was a distributor for Speroni's Coffee Service.\n</p>\n<p>\nSurviving besides his wife are a son, Robert (Sandra) Causer, Jr. of Syracuse; a daughter, Michele (William) Falzone of Branchport; three stepsons, Sean Sciabarrasi of Tonawanda, Frank Sciabarrasi and Thomas J. Puccinelli, both of Olean; five grandchildren; five step grandchildren; a brother, Richard (Sue) Causer of Osage Beach, Mo.; eight sisters, Thelma Davis, Glenna Larkin, Vera Fenton and Melva Swick, all of Port Allegany, Pa., Donna Chapman od Olean, Janet Swick of Rew, Pa., Carol Banks of Savage, Minn., and Joan (Charles) Sherwood of Clearwater, Fla.; and 53 nieces and nephews.\n</p>\n<p>\nHe was predeceased by two brothers, Kenneth Causer and Jack Causer.\n</p>\n<p>\nBurial will be in Pleasant Valley Cemetery.<br />\n----------------<br />\n\u00a9Published in the Olean, NY \"Times Herald\", 18 Jul 2003<br />\nUsed with permission\n</p>\n</div>\n</div>",
