"<div>\n<i class=\"NoteType\">\nURL\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.findagrave.com/memorial/24419045/ruth-bryant\n</p>\n</div>\n<i class=\"NoteType\">\nGeneral\n</i>\n<div class=\"grampsstylednote\">\n<p>\nThe Daily News, Batavia, Saturday, September 7, 1946:<br />\nWarsaw, Sept. 7 - Mrs. Ruth Smith Bryant, a resident of Warsaw for many years and lately of Buffalo, died in Warsaw Hospital yesterday, September 6, 2946. She was born in the town of Orangeville on October 22, 1914, a daughter of Abram and Mary Baker Smith. On October 20, 1941, she was married to Harold G. Bryant, who survives. She also is survived by her parents, Mr. and Mrs. Abram Smith of Orangeville, and 3 brothers and 3 sisters, Mrs. Arden Ewing of Espiville, Pa., Mrs. Harold Smith, Norman, Mrs. Stuart Nevinger, Laurence and Lynn Smith, all of Warsaw. She was a member of the Warsaw Evangelical Church, where services will be held at 3:00 tomorrow afternoon following prayers at the home of her parents in Orangeville at 2:15. The Rev. David B. McCleery, pastor of the church, will officiate and burial will be in Warsaw cemetery.\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nGeneral\n</i>\n<div class=\"grampsstylednote\">\n<p>\nWife of Joseph Edward King,daughter of Benjamin Boyer &amp; esther Saunders of Frankford,Ontario,Canada\n</p>\n</div>\n<i class=\"NoteType\">\nURL\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.findagrave.com/memorial/53703540/sarah-jane-king\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nURL\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.findagrave.com/memorial/24313807/sarah-m.-sergel\n</p>\n</div>\n<i class=\"NoteType\">\nGeneral\n</i>\n<div class=\"grampsstylednote\">\n<p>\nWyoming County Times, Thursday, December 10, 1936:<br />\nSarah M. Sergel, widow of Charles Sergel died at the home of her son, Henry Sergel of Warsaw on Tuesday, December 8th. She was born in Orangeville on December 2, 1863 and was the daughter of Philip and Filippina Dick Smith. Surviving her are 3 sons, William Sergel of Newark, Ernest Sergel of Ransomville and Henry Sergel of Warsaw, ten grandchildren and 2 great grandchildren, one brother, John P. Smith of Warsaw and 2 sisters, Mrs. William Miller of Warsaw and Mrs. Kate Schneckenburger of Buffalo. The funeral will be held at the Methodist church in Warsaw on Friday, December 11, at 2:30 with the Rev. Oliver Gesell, Rev. J.W. Sanderson and Rev. J.J. Baker officiating. The burial will be in the Warsaw cemetery. Mrs. Sergel was a member of the Evangelical church of Warsaw.\n</p>\n</div>\n</div>",
