"<div>\n<i class=\"NoteType\">\nSource text\n</i>\n<div class=\"grampsstylednote\">\n<p>\nWyoming County Times, November 9, 1961<br />\nGolden Wedding Anniversary for The Smiths<br />\nMr. and Mrs. Abram Smith of R.D. 1 Warsaw will celebrate their Golden Wedding anniversary on Sunday November 12 with relatives and friends at an open house in the social room of the Evangelical United Brethren Church.\n</p>\n<p>\nMr and Mrs Smith were married on November 16, 1911 at Newark, New York by the Rev. George Fox. They are parents of three sons: Norman of Warsaw, Lawrence of LeRoy and Lynn of Warsaw. Their daughters are Mrs. Arden Ewing of Yuma, Arizona, Mrs. Harold Smith and Mrs. Stuart Nevinger of Warsaw. Another daughter, Mrs. Ruth Bryant died in 1945. THey have twenty grand children and one great grandchild.\n</p>\n</div>\n</div>",
