"<div>\n<i class=\"NoteType\">\nURL\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.findagrave.com/memorial/8064672/john-philip-smith\n</p>\n</div>\n<i class=\"NoteType\">\nGeneral\n</i>\n<div class=\"grampsstylednote\">\n<p>\nA farmer who had lived in the town of Warsaw for 88 years died at his home. Born in Orangeville, the son of Philip and Phillipine Dick Smith; he was probably the oldest person in Warsaw. In December, 1888 he married Elizabeth Wagenblass who survives him as well as 6 children, George A. Smith, Benjamin D. Smith, Carl P. Smith, Wesley H. Smith, all of Warsaw, Mrs. Arthur B. Welker and Mrs. Dorothy Nevinger of Attica, 19 grandchildren and 16 great grandchildren. Member of the Evangelical United Brethren Church and a charter member of the Dairymen\"s League.\n</p>\n</div>\n</div>",
