"<div>\n<i class=\"NoteType\">\nCitation\n</i>\n<div class=\"grampsstylednote\">\n<p>\nSource Citation\n</p>\n<p>\nYear: 1880; Census Place: Orangeville, Wyoming, New York; Roll: 948; Page: 201B; Enumeration District: 207<br />\nDescription\n</p>\n<p>\nEnumeration District: 207; Description: Town of Orangeville<br />\nSource Information\n</p>\n<p>\nAncestry.com and The Church of Jesus Christ of Latter-day Saints. 1880 United States Federal Census [database on-line]. Lehi, UT, USA: Ancestry.com Operations Inc, 2010. 1880 U.S. Census Index provided by The Church of Jesus Christ of Latter-day Saints \u00a9 Copyright 1999 Intellectual Reserve, Inc. All rights reserved. All use is subject to the limited use license and other terms and conditions applicable to this site.<br />\nOriginal data:Tenth Census of the United States, 1880. (NARA microfilm publication T9, 1,454 rolls). Records of the Bureau of the Census, Record Group 29. National Archives, Washington, D.C.<br />\nSource Description\n</p>\n<p>\nThis database is an index to 50 million individuals enumerated in the 1880 United States Federal Census. Census takers recorded many details including each person's name, address, occupation, relationship to the head of household, race, sex, age at last birthday, marital status, place of birth, parents\u2019 place of birth. Additionally, the names of those listed on the population schedule are linked to actual images of the 1880 Federal Census.\n</p>\n</div>\n</div>",
