"<div>\n<i class=\"NoteType\">\nURL\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.findagrave.com/memorial/69636434/thelma-l-davis\n</p>\n</div>\n<i class=\"NoteType\">\nGeneral\n</i>\n<div class=\"grampsstylednote\">\n<p>\nDaughter of Glenn \"Babe\" &amp; Dorothy Kinney Causer<br />\nmarried 7 Jun 1949 George O Davis who died 15 Apr 1983\n</p>\n</div>\n</div>",
