"<div>\n<i class=\"NoteType\">\nURL\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.findagrave.com/memorial/61748590/ursula-brown\n</p>\n</div>\n<i class=\"NoteType\">\nGeneral\n</i>\n<div class=\"grampsstylednote\">\n<p>\nSpouse of Nehemiah Brown<br />\nAge 67 years<br />\nHstorical Wyoming, November 1949\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nURL\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.findagrave.com/memorial/18554587/walter-j.-herman\n</p>\n</div>\n<i class=\"NoteType\">\nGeneral\n</i>\n<div class=\"grampsstylednote\">\n<p>\nWestern New Yorker, July 5, 1923<br />\nWalter J. Herman of Buffalo died at the Warsaw hospital on Sunday, July 1st. He was the son of Theodore and Louise Streamer Herman and was born in Orangeville on Sept. 25, 1878. He was a railroad telegraph operator and a member of Crystal Salt Lodge, No 505, I.O.O.F., of Warsaw and of the Order of the Moose of Buffalo. Surviving are three brothers, William of Rochester, Earl and Miles Herman, of Warsaw, and one sister, Clara Wilcox of Warsaw. The Funeral service was held from the home of his brother, Earl herman on Tuesday afternoon at two o'clock, Rev. J. Archie Barker officiating. Burial was in Warsaw cemetery.\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nCitation\n</i>\n<div class=\"grampsstylednote\">\n<p>\n\"New York, New York City Marriage Records, 1829-1940,\" database, FamilySearch (https://familysearch.org/ark:/61903/1:1:24SB-WS9 : 10 February 2018), John Ward and Anne Elliott, 27 Dec 1886; citing Marriage, Manhattan, New York, New York, United States, New York City Municipal Archives, New York; FHL microfilm 1,570,941.\n</p>\n</div>\n<i class=\"NoteType\">\nURL\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://familysearch.org/ark:/61903/1:1:24SB-WS9\n</p>\n</div>\n</div>",
