"<div>\n<i class=\"NoteType\">\nURL\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.findagrave.com/memorial/25956958/willard-j.-crawford\n</p>\n</div>\n<i class=\"NoteType\">\nGeneral\n</i>\n<div class=\"grampsstylednote\">\n<p>\nDied at Stronog Memorial Hospital, Rochester. Born in Rock Glen the son of Joseph R. and Clara Warren Crawford. Member of the United Church, Warsaw; Warsaw Masonic Lodge 549 F. &amp; A.M. and Warsaw Exempt Firemen. Employed at Oscar Oram Ford Garage; Bob Arnold grocery store and Embury Lantern Co. He was a meat cutter at Edward M. Davis store in Rock Glen for 11 years. He retired 6/21/1977 from the Wyoming County Highway Dept. His 1st wife Dorothy Meissel Crawford died 12/3/1956. Surviving is his 2nd wife Elva Fagan Crawford whom he married 6/3/1959; 3 sons Gary (Clarice) Crawford, Syracuse; Bruce (Cheryl) Crawford, Warsaw; Gary (Gayle) Tiede, Warsaw; a daughter Shelley (Burt) Forsythe, Lynden, Washington. 2 brothers, John (Theresa) Crawford, Warsaw; Daniel (Lettie) Crawford, Geneseo; 3 sisters, Jean(Arthur) Todd, Warsaw; Dorothy (Richard) Herman, Warsaw; Norma (Warren) Graham, Wellsville. 9 grandchildren; 10 great grandchildren. Weeks Funeral Home handled arrangements.\n</p>\n</div>\n</div>",
"",
"<div>\n<i class=\"NoteType\">\nURL\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.findagrave.com/memorial/18554593/william-h.-herman\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nURL\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.findagrave.com/memorial/18554593/william-h.-herman\n</p>\n</div>\n<i class=\"NoteType\">\nGeneral\n</i>\n<div class=\"grampsstylednote\">\n<p>\nAge 83, A Wyoming County native died in Los Angeles, CA., where he lived for the past 15 years. He was the son of Theodore and Louise Streamer Herman and is survived by a sister, Mrs. Walter Wilcox of Warsaw and a niece and several nephews. Prior to his retirement he was employed by the Shontz Button factory in Rochester.\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nURL\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.findagrave.com/memorial/62224038/william-shader\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nURL\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.findagrave.com/memorial/63869037/william-shader-brown\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nURL\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttp://nyshistoricnewspapers.org/lccn/sn84035923/1958-07-03/ed-1/seq-8/\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n<i class=\"NoteType\">\nSource text\n</i>\n<div class=\"grampsstylednote\">\n<p>\nMiles G. Herman, a farmer of the West Hill, Warsaw who had been ill for a long time passed away suddenly at his home on Thursday June 26th. He was born in Orangeville on October 6, 1882 the son of Theodore and Louise Streamer Herman and on January 17, 1906 he married Nellie Reitzel, who survives together with three children, Mrs. Marvin S. Cohen of Niagara Falls, N.Y., Onias N. herman and Richard Herman of Warsaw, six grandchildren, a brother; William Herman of Los Angeles, California and a sister, Mrs. Walter Wilcox of Warsaw. The funeral was held at the Weeks Funeral Home on Sunday, June 29th at 2:30 o'clock with the interment in the Warsaw cemetery. The Rev. Frederick Carlsen of the Evangelical United Brethren church officiated.\n</p>\n</div>\n</div>"
